import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import PopisBodova from './pages/PopisBodova';

function App() {
  return (
    <Router>
      <div>
        <h1>Welcome to the App</h1>
        <Link to="/popis-bodova"><button>Open Popis Bodova</button></Link>
        <Switch>
          <Route path="/popis-bodova">
            <PopisBodova />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
